import { __decorate } from "tslib";
import __NG_CLI_RESOURCE__0 from "./signup.component.html?ngResource";
import __NG_CLI_RESOURCE__1 from "./signup.component.css?ngResource";
import { Component } from '@angular/core';
import { AuthService } from "../auth.service";
import { UIService } from "../../shared/ui.service";
import { Subscription } from "rxjs";
let SignupComponent = class SignupComponent {
    constructor(authService, uiService) {
        this.authService = authService;
        this.uiService = uiService;
        this.isLoading = false;
        this.loadingSubscription = new Subscription();
        this.maxDate = new Date();
    }
    ngOnInit() {
        this.loadingSubscription =
            this.uiService
                .loadingStateChange$
                .subscribe((isLoadingState) => {
                this.isLoading = isLoadingState;
            }, (error) => {
                console.log('error :', error);
            });
        this.maxDate.setFullYear(this.maxDate.getFullYear() - 18);
    }
    onSubmit(form) {
        this.authService.registerUser({
            email: form.value.email,
            password: form.value.password
        })
            .subscribe((result) => {
            if (result) {
                this.authService.authSuccessfully();
            }
        }, (error) => {
            console.log('error :', error);
            this.uiService.showSnackBar("error when register", undefined, 3000);
        });
    }
    ngOnDestroy() {
        this.loadingSubscription.unsubscribe();
    }
};
